import React from 'react';
import './Post.css';

export default function Post(props) {

  const posts = props.posts;

  return (
    <div className="post">
      {posts.map((val,index) => {
        return <div key={index}>
          <p>{val.name}</p><br />
          <p>{val.info}</p>
        </div>
      })}
    </div>
  );
}
